import React from 'react';

import {
    RowSection,
    SectionTitle,
    CustomSelecter
} from '../../static/StyledComponents';

const FormBusinessFatherInput = props => {
    return (
        <React.Fragment>
            <RowSection>
                <SectionTitle>Pai empresarial</SectionTitle>
            </RowSection>
            <CustomSelecter onChange={e => console.log(e.target.key)}>
                <option>test</option>
                {props.businessFatherOptions && props.businessFatherOptions.map((element, key) => {
                    return <option key={element.id}>{element.nome}</option>
                })}
            </CustomSelecter>
        </React.Fragment>
    );
};

export default FormBusinessFatherInput;
